const Button = ({onClickP}) => {
    return(
        <Fragment>
        <input className='f6 link dim ph3 pv2 mb2 dib white bg-light-purple' type='submit' value='send' onClick={onClickP}/>
        <div class="ph3">
            {/* <a class="f6 link dim ph3 pv2 mb2 dib white bg-light-purple" href="#0">Button Text</a> */}
        </div>
        </Fragment>
    )
}

export default Button;
